import "./hero-section.css";

function HeroSection() {
  return (
    <div className="hero_section">
        <div>
      <div className="left-container">
        <img src="images/Frame.svg" alt="" />
      </div>
      <div className="right-container"></div>
      </div>
    </div>
  );
}

export default HeroSection;
